import ReactDOM from 'react-dom';
import Sentence from "./sentence/sentence.js";
import Gallery from './gallery/gallery.js'


class ContentHome extends React.Component{
  render(){
    return(
      <div>
      <Sentence />
      <Gallery className="row"/>
      </div>
  )}
}
export default ContentHome;
